    data: |
      SELECT + col2 / + col0 AS col0 FROM tab0 WHERE ( - ( + - 4 ) ) NOT BETWEEN 38 AND col0 * + col1 + - col0 * col2 + 27;
  - name: tab0

outputs:
  - name: q10661.out
    data: |
      0
      1
      3
